import React, { useEffect, useRef } from 'react';
import { Box } from '@chakra-ui/react';
import * as THREE from 'three';
import { OrbitControls } from 'three/examples/jsm/controls/OrbitControls';

interface Planet {
  name: string;
  position: [number, number, number];
  radius: number;
  color: string;
  realRadius: number;  // km
  distanceFromSun: number;  // AU
  orbitalPeriod: number;  // Earth years
}

// Planet data sourced from NASA's planetary fact sheets
const planets: Planet[] = [
  { 
    name: 'Mercury',
    position: [1.5, 0, 0],
    radius: 0.4,
    color: '#A0522D',
    realRadius: 2439.7,
    distanceFromSun: 0.387,
    orbitalPeriod: 0.24,
  },
  { 
    name: 'Venus',
    position: [2.8, 0, 0],
    radius: 0.9,
    color: '#DEB887',
    realRadius: 6051.8,
    distanceFromSun: 0.723,
    orbitalPeriod: 0.62,
  },
  { 
    name: 'Earth',
    position: [4, 0, 0],
    radius: 1,
    color: '#1a75ff',
    realRadius: 6371,
    distanceFromSun: 1,
    orbitalPeriod: 1,
  },
  { 
    name: 'Mars',
    position: [5.5, 0, 0],
    radius: 0.5,
    color: '#ff4d4d',
    realRadius: 3389.5,
    distanceFromSun: 1.524,
    orbitalPeriod: 1.88,
  },
  { 
    name: 'Jupiter',
    position: [8, 0, 0],
    radius: 2,
    color: '#ffcc00',
    realRadius: 69911,
    distanceFromSun: 5.203,
    orbitalPeriod: 11.86,
  },
  { 
    name: 'Saturn',
    position: [11, 0, 0],
    radius: 1.8,
    color: '#F4D03F',
    realRadius: 58232,
    distanceFromSun: 9.537,
    orbitalPeriod: 29.46,
  },
  { 
    name: 'Uranus',
    position: [14, 0, 0],
    radius: 1.2,
    color: '#85C1E9',
    realRadius: 25362,
    distanceFromSun: 19.191,
    orbitalPeriod: 84.01,
  },
  { 
    name: 'Neptune',
    position: [17, 0, 0],
    radius: 1.2,
    color: '#3498DB',
    realRadius: 24622,
    distanceFromSun: 30.069,
    orbitalPeriod: 164.79,
  },
];

export const InterstellarMap: React.FC = () => {
  const mountRef = useRef<HTMLDivElement>(null);

  useEffect(() => {
    if (!mountRef.current) return;

    // Scene setup
    const scene = new THREE.Scene();
    scene.background = new THREE.Color('#000000');

    const camera = new THREE.PerspectiveCamera(
      75,
      mountRef.current.clientWidth / mountRef.current.clientHeight,
      0.1,
      1000
    );

    const renderer = new THREE.WebGLRenderer({ antialias: true });
    renderer.setSize(mountRef.current.clientWidth, mountRef.current.clientHeight);
    mountRef.current.appendChild(renderer.domElement);

    // Add ambient light
    const ambientLight = new THREE.AmbientLight(0xffffff, 0.5);
    scene.add(ambientLight);

    // Add directional light (Sun)
    const directionalLight = new THREE.DirectionalLight(0xffffff, 1);
    directionalLight.position.set(-5, 5, 0);
    scene.add(directionalLight);

    // Add the Sun
    const sunGeometry = new THREE.SphereGeometry(1.5, 32, 32);
    const sunMaterial = new THREE.MeshBasicMaterial({
      color: 0xffff00,
      emissive: 0xffff00,
    });
    const sun = new THREE.Mesh(sunGeometry, sunMaterial);
    sun.position.set(-3, 0, 0);
    scene.add(sun);

    // Add point light at Sun's position
    const sunLight = new THREE.PointLight(0xffffff, 2, 100);
    sunLight.position.copy(sun.position);
    scene.add(sunLight);

    // Camera position
    camera.position.z = 20;
    camera.position.y = 10;
    camera.lookAt(0, 0, 0);

    // Add OrbitControls
    const controls = new OrbitControls(camera, renderer.domElement);
    controls.enableDamping = true;
    controls.dampingFactor = 0.05;
    controls.maxDistance = 50;
    controls.minDistance = 5;

    // Add planets
    const planetMeshes = planets.map(planet => {
      const geometry = new THREE.SphereGeometry(planet.radius, 32, 32);
      const material = new THREE.MeshStandardMaterial({
        color: planet.color,
        roughness: 0.7,
        metalness: 0.3,
      });
      const sphere = new THREE.Mesh(geometry, material);
      sphere.position.set(...planet.position);
      scene.add(sphere);

      // Add orbit line
      const orbitGeometry = new THREE.RingGeometry(
        Math.sqrt(planet.position[0] ** 2 + planet.position[2] ** 2) - 0.1,
        Math.sqrt(planet.position[0] ** 2 + planet.position[2] ** 2) + 0.1,
        64
      );
      const orbitMaterial = new THREE.MeshBasicMaterial({
        color: 0x444444,
        side: THREE.DoubleSide,
        transparent: true,
        opacity: 0.3,
      });
      const orbit = new THREE.Mesh(orbitGeometry, orbitMaterial);
      orbit.rotation.x = Math.PI / 2;
      scene.add(orbit);

      return { mesh: sphere, orbitalPeriod: planet.orbitalPeriod };
    });

    // Animation loop
    let time = 0;
    const animate = () => {
      requestAnimationFrame(animate);
      time += 0.005;

      // Rotate planets
      planetMeshes.forEach((planet, index) => {
        const speed = 0.1 / planet.orbitalPeriod;
        const radius = planets[index].position[0];
        planet.mesh.position.x = Math.cos(time * speed) * radius;
        planet.mesh.position.z = Math.sin(time * speed) * radius;
        planet.mesh.rotation.y += 0.01;
      });

      controls.update();
      renderer.render(scene, camera);
    };
    animate();

    // Handle window resize
    const handleResize = () => {
      if (!mountRef.current) return;
      const width = mountRef.current.clientWidth;
      const height = mountRef.current.clientHeight;
      camera.aspect = width / height;
      camera.updateProjectionMatrix();
      renderer.setSize(width, height);
    };

    window.addEventListener('resize', handleResize);

    // Cleanup
    return () => {
      window.removeEventListener('resize', handleResize);
      mountRef.current?.removeChild(renderer.domElement);
    };
  }, []);

  return (
    <Box
      ref={mountRef}
      w="100%"
      h="100%"
      borderRadius="xl"
      overflow="hidden"
      position="relative"
    />
  );
};
